column3:
CARTER, Buddy, a Representative from Georgia; born in Port Wentworth, Chatham 

County, Ga., September 6, 1957; graduated from Robert W. Groves High School, 

Garden City, Ga., 1975; A.A., Young Harris College, Young Harris, Ga., 1977; 

B.S., University of Georgia, Athens, Ga., 1980; pharmacist; business owner; 

member of the Pooler, Ga., city council, 1994-1995; mayor of Pooler, Ga., 

1996-2004; member of the Georgia state house of representatives, 2005-2009; 

member of the Georgia state senate, 2009-2014; elected as a Republican to the 

One Hundred Fourteenth Congress (January 3, 2015-present).

ABRAHAM, Ralph, a Representative from Louisiana; born in Alto, Richland Parish, La., 

September 16, 1954; graduated from Mangham High School, Mangham, La., 1972; 

B.A., Louisiana State University, Baton Rouge, La., 1980; D.V.M., Louisiana 

State University School of Veterinary Medicine, Baton Rouge, La., 1980; M.D., 

Louisiana State University School of Medicine, New Orleans, La., 1994; 

Mississippi National Guard Special Forces, 1986-1989; flight instructor; 

general family practitioner; aviation medical examiner; elected as a Republican 

to the One Hundred Fourteenth Congress (January 3, 2015-present).

LAWRENCE, Brenda L, a Representative from Michigan; born in Detroit, Wayne County, 

Mich., October 18, 1954; graduated from Pershing High School, Detroit, Mich.; 

attended University of Detroit Mercy, Detroit, Mich.; B.A., Central Michigan 

University, Mt. Pleasant, Mich., 2005; manager, United States Postal Service; 

member of the Southfield, Mich., board of education, 1992-1996; member of the 

Southfield, Mich., city council, 1997-2001; mayor of Southfield, Mich., 

2001-2014; unsuccessful candidate for Oakland County, Mich., executive in 2008; 

unsuccessful candidate for Michigan lieutenant governor in 2010; elected as a 

Democrat to the One Hundred Fourteenth Congress (January 3, 

2015-present).

CORKER, Robert (Bob), a Senator from Tennessee; born in Orangeburg, S.C., August 24, 1952; 
attended the public schools in Chattanooga, Tenn.; graduated with a bachelor of 
science degree in industrial management, University of Tennessee 1974; 
commercial real estate developer; construction company owner; unsuccessful 
candidate for the United States Senate 1994; commissioner, Tennessee Finance 
and Administration Department 1995-1996; mayor of Chattanooga 2001-2005; 
elected as a Republican to the United States Senate in 2006 for the term 
commencing January 3, 2007; reelected in 2012 for the term ending January 3, 
2019.

GRIFFITH, Parker, a Representative from Alabama; born in Shreveport, Caddo Parish, 
La., August 6, 1942; attended Loyola University, Chicago, Ill., 1962-1964; 
B.S., Louisiana State University, Baton Rouge, La., 1966; M.D., Louisiana State 
University, Baton Rouge, La., 1970; United States Army Reserve, 1970-1973; 
teacher; physician; businessman; real estate developer; unsuccessful candidate 
for mayor of Huntsville, Ala., in 2004; member, Alabama state senate, 
2006-2008; elected as a Democrat to the One Hundred Eleventh Congress; changed 
from the Democratic to Republican Party on December 22, 2009 (January 3, 
2009-January 3, 2011); unsuccessful candidate for nomination for One Hundred 
Twelfth Congress in 2010.

WAGNER, Ann, a Representative from Missouri; born in St. Louis, Mo., September 
13, 1962; B.S.B.A., University of Missouri, Columbia, Mo., 1984; businesswoman; 
chair, Missouri Republican Party, 1999-2005; co-chair, Republican National 
Committee, 2001-2005; United States Ambassador to Luxembourg, 2005-2009; 
elected as a Republican to the One Hundred Thirteenth Congress (January 3, 
2013-present).

WEBER, Randy, a Representative from Texas; born in Pearland, Brazoria County, 
Tex., July 2, 1953; attended Alvin Community College in Alvin, Tex., 1971-1974; 
B.S., University of Houston-Clear Lake, Houston, Tex., 1977; business owner; 
member of the Pearland, Tex., city council, 1990-1996; member of the Texas 
state house of representatives, 2008-2012; elected as a Republican to the One 
Hundred Thirteenth Congress (January 3, 2013-present).

ROBY, Martha, a Representative from Alabama; born in Montgomery, Montgomery 
County, Ala., July 27, 1976; B.M., New York University, New York, N. Y., 1998; 
J.D., Samford University, Birmingham, Ala., 2001; lawyer, private practice; 
Montgomery, Ala., city council, 2003-2010; elected as a Republican to the One 
Hundred Twelfth and to the succeeding Congress (January 3, 2011-present).

RATCLIFFE, John, a Representative from Texas; born in Chicago, Cook County, Ill., 

October 20, 1965; B.A., University of Notre Dame, Notre Dame, Ind., 1987; J.D., 

Southern Methodist University, Dallas, Tex., 1989; lawyer, private practice; 

professor; United States attorney for the Eastern District of Texas, 2007-2008; 

mayor of Heath, Tex., 2004-2012; elected as a Republican to the One Hundred 

Fourteenth Congress (January 3, 2015-present).

SESSIONS, Jefferson Beauregard III (Jeff), a Senator from Alabama; born in Hybart, Ala., December 24, 1946; 
attended the public schools; graduated from Huntingdon College, Montgomery 
1969; graduated from University of Alabama School of Law, Tuscaloosa 1973; 
admitted to the Alabama bar in 1973, and engaged in the practice of law in 
Russellville 1973-1975; served in the U.S. Army reserves, attaining the rank of 
captain 1973-1977; practiced law in Mobile 1977-1981; United States Attorney 
for the Southern District of Alabama 1981-1993; Alabama Attorney General 
1994-1996; elected as a Republican to the United States Senate in 1996; 
reelected in 2002, and again in 2008 for the term ending January 3, 2015.

BINGAMAN, Jesse Francis, Jr. (Jeff), a Senator from New Mexico; born in El Paso, Tex., October 3, 1943; 
attended public schools of Silver City, N.Mex.; graduated, Harvard College 1965 
and Stanford Law School 1968; served in the United States Army Reserve 
1968-1974; admitted to the New Mexico bar 1968; assistant New Mexico attorney 
general 1969; counsel to State constitutional convention 1969; commenced 
private practice in 1970; elected New Mexico attorney general 1979-1982; 
elected as a Democrat to the United States Senate in 1982; reelected in 1988, 
1994, 2000, and 2006, and served from January 3, 1983, to January 3, 2013; 
chairman, Senate Impeachment Trial Committee (1989-1991), Committee on Energy 
and Natural Resources (One Hundred Seventh Congress [January 3-20, 2001; June 
6, 2001-January 3, 2003], One Hundred Tenth to One Hundred Twelfth Congresses); 
was not a candidate for reelection to the Senate in 2012.

FISCHER, Debra (Deb), a Senator from Nebraska; born in Lincoln, Neb., March 1, 1951; 
graduated University of Nebraska, B.S., 1988; rancher; Valentine Rural High 
School Board of Education 1990-2004; Nebraska Coordinating Commission for 
Postsecondary Education 2000-2004; Nebraska Unicameral Legislature 2005-2012; 
elected as a Republican to the United States Senate in 2012 for the term ending 
January 3, 2019.
